import React from "react"

const NavBar = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <div className="container-fluid">
        <span className="navbar-brand mb-0 h1 ml-auto">To do list</span>
      </div>
    </nav>
  )
}

export default NavBar
